import React, { useEffect } from "react";
import PropTypes from "prop-types";
import routes from "app/configs/routes.config";
import "perfect-scrollbar/css/perfect-scrollbar.css";
import "./layout_home.scss";
import "./index.scss";
import { ConfigProvider, Layout } from "antd";
import { Route, Switch } from "react-router-dom";
import { isMobile } from "react-device-detect";

const { Content } = Layout;

const LayoutHome = () => {
  const loading = (
    <div
      style={{
        height: "100%",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      Loading...
    </div>
  );
  useEffect(() => {
    document.body.classList.add("body-home-page");
  }, []);
  return (
    <div id={"layouthome-id"}>
      <ConfigProvider>
        <Layout
          className={"main-layout-home"}
          style={{
            clear: "both",
          }}
        >
          <Layout className="site-layout-home">
            <Content
              className={isMobile ? "main-content-home" : "main-content-home"}
              style={{
                background: "url('background-register.png') !important",
              }}
            >
              <React.Suspense fallback={loading}>
                <Switch>
                  {routes.map((route, idx) =>
                    route.component ? (
                      <Route
                        key={String(idx)}
                        path={route.path}
                        exact={route.exact}
                        name={route.name}
                        render={(renderProps) => (
                          <route.component {...renderProps} />
                        )}
                      />
                    ) : null
                  )}
                </Switch>
              </React.Suspense>
            </Content>
            {/*<FooterHome />*/}
          </Layout>
        </Layout>
      </ConfigProvider>
    </div>
  );
};

LayoutHome.propTypes = {
  children: PropTypes.element,
};

export default LayoutHome;
